  [],\n\t\"num_tags\": 19,\n\t\"name\": \"the-effects-of-hydroperiod-and-nutrient-levels-on-root-dynamics-in-a-seasonally-flooded-sw\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The major objectives of this study were;
  1) to test and evaluate several modified methods for measuring root production and
  decay, 2) to measure root production and decay in situ in four different communities
  in a periodically flooded swamp (the Great Dismal Swamp) and correlate rates with
  hydrology and other critical environmental parameters, and 3) to test hypotheses
  related to the effects of hydroperiod and nutrient levels on below ground processes
  in a greenhouse experiment using Acer rubrum seedlings. This report  summarizes
  the results available at the end of the funded period.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
